import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './Table/navbar';
import Login from './Table/helloworld';
import Wilaya from './Table/wilaya';
import './App.css';
import { SessionContext } from './session';
function App() {

  return (
    <Router>
      {/* <SessionContext> */}
        <Navbar/>
          <div>
            <div className="mt-20"></div>
            <Routes>
              <Route path="/wilaya" element={<Wilaya />} />
              <Route path="/" element={<Login />} />
            </Routes>
          </div>
        {/* </SessionContext> */}
    </Router>
  );
}

export default App;
